DROP PROCEDURE IF EXISTS `FiltrarDatos`;
delimiter ;;
CREATE PROCEDURE `FiltrarDatos`(in origen varchar(100), destino varchar(100),fechainicio VARCHAR(100),fechafin varchar(100),estatus varchar(100), ciudadfiltro varchar(100))
BEGIN
SELECT calldate,src,dst,duration,disposition,ciudad FROM ViewSucursales where (src=origen or origen is null) and  (dst=destino or destino is null) and (calldate BETWEEN fechainicio and fechafin or fechainicio is null and fechafin is null) and (disposition=estatus or estatus is null) and (ciudad=ciudadfiltro or ciudadfiltro is null);
END
;;
delimiter ;

